'2014-12-08 03:25:46','1867FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(1883,5258,'A highly infectious viral disease that chiefly affects children and, in its acute forms, causes inflammation of motor neurons of the spinal cord and brainstem, leading to paralysis, muscular atrophy, and often deformity. Through vaccination, the disease is preventable. Also called infantile paralysis.','en',1,'2004-08-12 00:00:00',1,NULL,'1883FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(1966,5340,'WHO Peds Stage 3 / WHO Stage 4 Adult Conditions - Candidiasis (Esophageal, Bronchi, Trachea, Or Lungs)','en',1,'2004-08-12 00:00:00',1,'2013-06-01 19:46:15','1966FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(2253,5622,'A generic, descriptive answer which is a handwritten, non-coded response to a question.','en',1,'2004-08-12 00:00:00',1,'2014-09-13 21:47:32','2253FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(2729,71617,'dawa ya kupunguza maumivu','sw',1,'2007-12-11 21:17:03',1,'2014-08-05 15:47:59','2729FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(2898,111061,'A vascular reaction of the skin characterized by erythema and wheal formation due to localized increase of vascular permeability. The causative mechanism may be allergy, infection, or stress.','en',1,'2007-10-18 04:28:24',1,'2013-09-30 19:53:15','2898FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(2993,111633,'Infections affecting those structures of the body which participate in the secretion and elimination of urine, i.e., the kidney, the ureters, the urinary bladder, and the urethra.','en',1,'2007-11-02 20:12:25',1,NULL,'2993FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3280,112287,'A chronic infection of the conjunctiva and cornea caused by CHLAMYDIA TRACHOMATIS.','en',1,'2007-10-18 04:28:24',1,NULL,'3280FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3368,112561,'Traumatic injuries involving the cranium and intracranial structures (i.e., BRAIN; CRANIAL NERVES; MENINGES; and other structures). Injuries may be classified by whether or not the skull is penetrated (i.e., penetrating vs. nonpenetrating) or whether there is an associated hemorrhage.','en',1,'2007-10-18 04:28:24',1,NULL,'3368FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3499,112989,'A pathological condition that can suddenly affect the hemodynamic equilibrium, usually manifested by failure to perfuse or oxygenate vital organs.','en',1,'2007-10-18 04:28:24',1,'2013-09-10 14:05:47','3499FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3500,112992,'Diseases due to or propagated by sexual contact.','en',1,'2007-10-18 04:28:24',1,'2014-10-02 21:30:00','3500FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3599,113230,'The most important manifestation of and sequel to rheumatic fever, i.e., any cardiac involvement in rheumatic fever. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'3599FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3854,113881,'Anxiety disorders manifested by the development of characteristic symptoms following a psychologically traumatic event that is outside the normal range of usual human experience. Symptoms include re-experiencing the traumatic event and numbing of responsiveness to or reduced involvement with the external world.','en',1,'2007-10-18 04:28:24',1,NULL,'3854FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3911,114100,'Inflammation of the lungs.','en',1,'2007-11-02 20:06:58',1,NULL,'3911FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3941,114174,'Inflammation of a vein associated with thrombus formation.','en',1,'2007-10-18 04:28:24',1,NULL,'3941FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4485,115797,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'4485FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4501,115835,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-11-02 20:02:40',1,'2011-12-22 18:03:16','4501FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4639,116128,'A protozoan disease caused by four species of the genus PLASMODIUM (P. falciparum (MALARIA, FALCIPARUM), P. vivax (MALARIA, VIVAX), P. ovale, and P. malariae) and transmitted by the bite of an infected female mosquito of the genus Anopheles. Malaria is endemic in parts of Asia, Africa, Central and South America, Oceania, and certain Caribbean islands. It is characterized by extreme exhaustion associated with paroxysms of high fever, sweating, shaking chills, and anemia.','en',1,'2007-11-02 19:28:08',1,'2012-06-03 17:14:05','4639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4676,116214,'Abnormally low blood pressure seen in shock but not necessarily indicative of it. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'4676FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4719,116376,'A sudden, nonconvulsive loss of neurologic function due to an ischemic or hemorrhagic intracranial vascular event. In general, cerebrovascular accidents are classified by anatomic location in the brain, vascular distribution, etiology, age of the affected individual, and hemorrhagic vs. nonhemorrhagic nature. (From Adams et al., Principles of Neurology, 6th ed, pp777-810)','en',1,'2007-10-18 04:28:24',1,NULL,'4719FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4745,116474,'The lack of sufficient energy or protein to meet the body\'s metabolic demands, as a result of either an inadequate dietary intake of protein, intake of poor quality dietary protein, increased demands due to disease, or increased nutrient losses.','en',1,'2007-10-18 04:28:24',1,'2014-10-03 17:17:41','4745FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4775,116543,'Injuries to tissues caused by contact with heat, steam, chemicals (BURNS, CHEMICAL), electricity (BURNS, ELECTRIC), or the like.','en',1,'2007-10-18 04:28:24',1,NULL,'4775FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4831,116700,'Infestation with parasitic worms of the helminth class.','en',1,'2007-10-18 04:28:24',1,NULL,'4831FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4929,117146,'Infections in birds and mammals produced by various species of Trichomonas.','en',1,'2007-10-18 04:28:24',1,'2014-10-03 17:21:26','4929FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4933,117152,'SCHISTOSOMIASE','fr',1,'2007-09-06 09:05:28',1,NULL,'4933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4978,117315,'The condition that results from excessive loss of body water.','en',1,'2007-10-18 04:28:24',1,NULL,'4978FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5005,117386,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'5005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5011,117399,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,'2015-03-17 01:42:54','5011FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5205,117829,'Herpes simplex of the genitals.','en',1,'2007-10-18 04:28:24',1,NULL,'5205FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5228,117889,'Inflammation of the lining of the stomach and intestines, often accompanied by diarrhea.','en',1,'2007-11-02 20:20:58',1,NULL,'5228FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5445,118652,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'5445FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5495,118789,'Difficulty in swallowing.','en',1,'2007-11-02 20:15:17',1,'2014-10-17 14:58:13','5495FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5600,119112,'Diseases of the central and peripheral nervous system. This includes disorders of the brain, spinal cord, cranial nerves, peripheral nerves, nerve roots, autonomic nervous system, neuromuscular junction, and muscle.','en',1,'2007-10-18 04:28:24',1,NULL,'5600FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5623,119204,'The state of the body in relation to the intake and excretion of water and electrolytes, particularly sodium and potassium. It exists in a metabolic balance internally with BODY FLUID COMPARTMENTS, total BODY WATER, BLOOD VOLUME, EXTRACELLULAR SPACE, etc., externally through sensible and insensible SWEATING. The hypothalamus controls water balance. (Dorland, 27th ed; Mountcastle, Medical Physiology, 14th ed, 1980, p1152)','en',1,'2007-10-18 04:28:24',1,NULL,'5623FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5626,119240,'Diseases of the ear, general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'5626FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5662,119356,'Infection of humans or animals with hookworms other than those caused by the genus Ancylostoma or Necator, for which the specific terms ANCYLOSTOMIASIS and NECATORIASIS are available.','en',1,'2007-10-18 04:28:24',1,NULL,'5662FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5733,119481,'A heterogeneous group of disorders that share glucose intolerance in common.','en',1,'2007-11-02 20:10:30',1,'2012-06-06 18:24:28','5733FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5743,119506,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'5743FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5750,119523,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'5750FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5764,119558,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-11-02 20:08:47',1,'2011-12-22 18:39:36','5764FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5785,119656,'An ulceration caused by prolonged pressure in patients permitted to lie too still for a long period of time. The bony prominences of the body are the most frequently affected sites. The ulcer is caused by ischemia of the underlying structures of the skin, fat, and muscles as a result of the sustained and constant pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'5785FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5799,119685,'Inflammation of the urinary bladder. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'5799FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5924,120148,'Any variation from the normal rhythm or rate of the heart beat.','en',1,'2007-10-18 04:28:24',1,'2014-07-15 02:32:30','5924FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5938,120194,'Disorders or diseases associated with the six-to-eight-week period immediately following labor and delivery.','en',1,'2007-10-18 04:28:24',1,NULL,'5938FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6313,121262,'Infections by bacteria, general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'6313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6363,121372,'A sudden intense and continuous aggravation of a state of asthma, marked by dyspnea to the point of exhaustion and collapse and not responding to the usual therapeutic efforts.','en',1,'2007-10-18 04:28:24',1,'2014-12-22 22:22:05','6363FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6366,121375,'ugonjwa wa pumu','sw',1,'2007-12-11 21:17:36',1,'2013-05-07 14:24:50','6366FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6449,121629,'A reduction in the number of circulating erythrocytes or in the quantity of hemoglobin.','en',1,'2007-10-14 11:31:45',1,'2013-02-02 16:46:05','6449FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6450,121629,'ugonjwa wa kuvuja damu','sw',1,'2007-12-11 19:33:36',1,'2013-02-02 16:46:05','6450FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6722,122604,'An acute diarrheal disease endemic in India and Southeast Asia whose causative agent is VIBRIO CHOLERAE. This condition can lead to severe dehydration in a matter of hours unless quickly treated.','en',1,'2007-10-18 04:28:24',1,'2011-12-22 18:53:52','6722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6890,123052,'A nutritional condition produced by a deficiency of VITAMIN A in the diet, characterized by NIGHT BLINDNESS and other ocular manifestations such as dryness of the conjunctiva and later of the cornea (XEROPHTHALMIA). Vitamin A deficiency is a very common problem worldwide, particularly in developing countries as a consequence of famine or shortages of vitamin A-rich foods. In the United States it is found among the urban poor, the elderly, alcoholics, and patients with malabsorption. (From Cecil Textbook of Medicine, 19th ed, p1179)','en',1,'2007-10-18 04:28:24',1,NULL,'6890FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6933,123123,'Inflammation, often mild, of the conjunctiva caused by a variety of viral agents. Conjunctival involvement may be part of a systemic infection.','en',1,'2007-10-18 04:28:24',1,NULL,'6933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7066,123529,'DEF: Discharge of purulent fluid from the urethra. DESC: Commonly caused by Gonorrhea and/or chlamydia. REF: Merck Manual','en',1,'2007-10-18 04:28:24',1,NULL,'7066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7067,123529,'ECOULEMENT URETRAL','fr',1,'2007-07-13 14:56:43',1,NULL,'7067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7275,124129,'Infection with nematodes of the genus TRICHURIS, formerly called Trichocephalus.','en',1,'2007-10-18 04:28:24',1,NULL,'7275FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7773,126127,'Expulsion of the products of conception before the completion of gestation without deliberate interference.','en',1,'2007-10-18 04:28:24',1,NULL,'7773FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7801,126208,'Congenital defects of closure of one or more vertebral arches, which may be associated with malformations of the spinal cord, nerve roots, congenital fibrous bands, lipomas, and congenital cysts. These malformations range from mild (e.g., SPINA BIFIDA OCCULTA) to severe, including rachischisis where there is complete failure of neural tube and spinal cord fusion, resulting in exposure of the spinal cord at the surface. Spinal dysraphism includes all forms of spina bifida. The open form is called SPINA BIFIDA CYSTICA and the closed form is SPINA BIFIDA OCCULTA. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'7801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7914,126558,'An infectious disease caused by bacteria of the genus SHIGELLA. This condition is characterized by intestinal pain and diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'7914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8328,127579,'The persistence to perform a learned behavior (facts or experiences) after an interval has elapsed in which there has been no performance or practice of the behavior.','en',1,'2007-10-18 04:28:24',1,NULL,'8328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8452,127990,'Fever in which the etiology cannot be ascertained.','en',1,'2007-11-02 20:16:08',1,NULL,'8452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8508,128126,'Bronchial hemorrhage manifested with spitting of blood.','en',1,'2007-10-18 04:28:24',1,NULL,'8508FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9072,129566,'A developmental anomaly characterized by the presence of more than five fingers on the hand or more than five toes on the foot in primates. In non-primate vertebrates, it refers to the presence of more than the normal number of toes on the forelimb or hindlimb. (Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9072FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9467,131113,'Inflammation of the middle ear.','en',1,'2007-11-02 20:16:26',1,NULL,'9467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9468,131113,'Otite moyenne','fr',1,'2007-09-06 08:51:25',1,NULL,'9468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9762,132636,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning \'displaced child\'. Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9763,132636,'MARASME','fr',1,'2007-07-13 13:53:41',1,NULL,'9763FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10003,133414,'Acute conjunctival inflammation in the newborn, usually caused by maternal gonococcal infection. The baby\'s eyes are contaminated during passage through the birth canal.','en',1,'2007-10-18 04:28:24',1,'2014-12-09 02:49:00','10003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10318,134213,'Abnormal smallness of the head, usually associated with mental retardation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10354,134337,'Psychiatric illness or diseases manifested by breakdowns in the adaptational process expressed primarily as abnormalities of thought, feeling, and behavior producing either distress or impairment of function.','en',1,'2007-10-18 04:28:24',1,NULL,'10354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10416,134561,'A highly contagious infectious disease caused by MORBILLIVIRUS, common among children but also seen in the nonimmune of any age, in which the virus enters the respiratory tract via droplet nuclei and multiplies in the epithelial cells, spreading throughout the reticuloendothelial system. (From Dorland, 27th ed)','en',1,'2007-11-02 20:12:00',1,NULL,'10416FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10847,135462,'Subacute inflammation of the inguinal lymph glands caused by certain immunotypes of CHLAMYDIA TRACHOMATIS. It is a sexually transmitted disease in the U.S. but is more widespread in developing countries. It is distinguished from granuloma venereum (see GRANULOMA INGUINALE), which is caused by Calymmatobacterium granulomatis.','en',1,'2007-10-18 04:28:24',1,NULL,'10847FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11171,136443,'DEF:Yellow pigmentation of the skin and sclerae due to a raised level of plasma bilirubin. DESC: classified by the type of circulating bilirubin (conjugated or uncongugated). REF OXFORD CLINICAL MEDICINE','en',1,'2007-11-02 20:02:04',1,'2013-02-02 16:48:20','11171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11247,136677,'Infections of the intestines with a parasite. They are caused most commonly by intestinal nematodes (roundworms) and cestodes (tapeworms). (From Merck Manual, 15th ed; Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11247FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11276,136758,'Uterine bleeding, usually irregular or acyclic, between periods.','en',1,'2007-10-18 04:28:24',1,NULL,'11276FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11369,137293,'Skin diseases caused by bacteria, fungi, parasites, or viruses.','en',1,'2007-10-18 04:28:24',1,NULL,'11369FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11404,137352,'A genus of large tapeworms.','en',1,'2007-10-18 04:28:24',1,NULL,'11404FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11406,137355,'Infection with nematodes of the genus STRONGYLOIDES. The presence of larvae may produce pneumonitis and the presence of adult worms in the intestine could lead to moderate to severe diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'11406FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11759,138291,'Abnormally increased content of sugar in the blood. (Dorland, 27th ed)','en',1,'2007-10-18 04:28